import React, { useState, useEffect } from 'react';
import axios from 'axios';
import LogoImage from '../assets/logo.jpeg';
import '../styles/Login.css';
import { useNavigate } from 'react-router-dom';

function Signup() {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [message, setMessage] = useState('');
    const [location, setLocation] = useState(null);
    const [loading, setLoading] = useState(false);
    const [existingEmails, setExistingEmails] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        axios.get('http://localhost:4444/api/v1/users/emails')
            .then(response => setExistingEmails(response.data))
            .catch(error => console.error('Error fetching emails:', error));

        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(
                position => setLocation({
                    latitude: position.coords.latitude,
                    longitude: position.coords.longitude
                }),
                error => console.error('Error getting location:', error)
            );
        } else {
            console.error('Geolocation is not supported by this browser.');
        }
    }, []);

    const validateInputs = () => {
        if (!firstName || !lastName || !email || !password) {
            setMessage('Please fill in all fields.');
            return false;
        }
        if (existingEmails.includes(email)) {
            setMessage('Email already in use.');
            return false;
        }
        if (password !== confirmPassword) {
            setMessage('Passwords do not match!');
            return false;
        }
        return true;
    };

    const handleSignup = async (event) => {
        event.preventDefault();
        if (!validateInputs()) return;

        setLoading(true);
        try {
            const response = await axios.post('http://localhost:4444/api/v1/test/register', {
                firstName,
                lastName,
                email,
                password,
                latitude: location?.latitude,
                longitude: location?.longitude
            });

            if (response.data.userId) {
                sessionStorage.setItem('userId', response.data.userId);
                sessionStorage.setItem('firstName', firstName);
                sessionStorage.setItem('lastName', lastName);
                sessionStorage.setItem('email', email);
                setMessage('Signup successful!');
                navigate('/main');
            } else {
                setMessage('Signup failed. Please try again.');
            }
        } catch (error) {
            console.error('Error during signup:', error);
            setMessage('Signup failed!');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className='loginDiv'>
            <div className="img-logo" style={{ backgroundImage: `url(${LogoImage})` }}></div>
            <h2>İmdat</h2>
            <form onSubmit={handleSignup} className='login-form'>
                <div>
                    <label className='login-label'>First Name:</label>
                    <input type="text" value={firstName} onChange={(e) => setFirstName(e.target.value)} className='login-input' placeholder='Please enter your first name' />
                </div>
                <div>
                    <label className='login-label'>Last Name:</label>
                    <input type="text" value={lastName} onChange={(e) => setLastName(e.target.value)} className='login-input' placeholder='Please enter your last name' />
                </div>
                <div>
                    <label className='login-label'>Email:</label>
                    <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} className='login-input' placeholder='Please enter your email' />
                </div>
                <div>
                    <label className='login-label'>Password:</label>
                    <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} className='login-input' placeholder='Please enter your password' />
                </div>
                <div>
                    <label className='login-label'>Confirm Password:</label>
                    <input type="password" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} className='login-input' placeholder='Please confirm your password' />
                </div>
                <button type="submit" className='login-button' disabled={loading}>{loading ? 'Signing Up...' : 'Signup'}</button>
            </form>
            {message && <p>{message}</p>}
            <div className='link-div'>
                <a href='#' className='signup-link' onClick={() => navigate('/')}>I already have an account</a>
            </div>
        </div>
    );
}

export default Signup;
